import React from "react";
import InstagramEmbed from "react-instagram-embed";

const SocialFeedFB = () => {
	const instaToken = "e970a8d9670bb55d6307e749eaa991bd"; //required to access the Instagram API
	const instaAppId = "855434338435342"; //appID for FB and Instagram
	return (
		<>
			<InstagramEmbed
				url="https://www.instagram.com/timberbushtours"
				clientAccessToken="{instaAppId}|{instaToken}"
				maxWidth={320}
				hideCaption={false}
				containerTagName="div"
				protocol=""
				injectScript
				onLoading={() => {}}
				onSuccess={() => {}}
				onAfterRender={() => {}}
				onFailure={() => {}}
			/>
		</>
	);
};

export default SocialFeedFB;
